import './App.css';
import react, {useState, useEffect} from 'react'
import Grid from '@mui/material/Grid';

import { TextField, Autocomplete, Button } from '@mui/material';
import Snackbar from '@mui/material/Snackbar';
import MuiAlert, { AlertProps } from '@mui/material/Alert';


function App() {

  const [name, setName] = useState("");

    useEffect(() => {

    }, [])

    async function submit() {

    }

    const [open, setOpen] = useState(false);
    const [open2, setOpen2] = useState(false);

    const handleClose =()=>{
      setOpen(false);
    }
    const handleClose2 =()=>{
      setOpen2(false);
    }


  return (
    <>
    <Snackbar
        open={open}
        autoHideDuration={6000}
        onClose={handleClose}
        message="Message Sent!"
      >
          <MuiAlert
          severity='success'
          variant="filled"
          sx={{  width: 300 }}
          >
            Message Sent !
            </MuiAlert>
      </Snackbar>

      <Snackbar
        open={open2}
        autoHideDuration={6000}
        onClose={handleClose2}
        message="Message Sent!"
      >
          <MuiAlert
          severity='error'
          variant="filled"
          sx={{  width: 300 }}
          >
            Could not send, check form.
            </MuiAlert>
      </Snackbar>


    <div id="loader"></div>
<div>

    <div className='body'>
    <div className="">  
    <Grid container spacing={10}>

      <Grid item lg={12}>
        <div className='title'>
          <h1>Medical Misinformation Detector</h1>
        </div>
      </Grid>
      <Grid item lg={8} sm={12} xs={12}>


        <div className="">

      <h1>Assessment Form</h1>
      <h3>Please enter your information so we can assess how we can help you</h3>
      <br></br>
      <TextField id="standard-basic" 
      required='true'
      fullWidth
      label="Full Name" 
      type="name"
      autoComplete='name'
      variant="standard" 
      value={name}
      onChange={(e) => setName(e.target.value)}
      />
        <Button
        fullWidth
        onClick={()=>{submit()}}>
          Submit Assessment Form
        </Button>
        </div>

      </Grid>
    </Grid>
    </div>
    </div>
    </div>
</>

  );
}

export default App;
